import React from 'react';
import { Card, CardContent, Typography, Box, Button } from '@mui/material';

export const CardComponent = ({ icon: Icon, title, text, btnColor }) => {
  return (
    <Card sx={{ backgroundColor: btnColor === 'primary' ? 'dark.main' : 'secondary.main', color: 'white', textAlign: 'center' }}>
      <CardContent>
        <Box sx={{ fontSize: '3rem', mb: 3 }}>
          <Icon />
        </Box>
        <Typography variant="h5" component="div" sx={{ mb: 3 }}>
          {title}
        </Typography>
        <Typography variant="body2" sx={{ mb: 3 }}>
          {text}
        </Typography>
        <Button variant="contained" color={btnColor}>
          Read More
        </Button>
      </CardContent>
    </Card>
  );
};
